import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import logo from '../media/otter.svg';
import withRoot from '../withRoot';

const styles = theme => ({
    root: {
        flexGrow: 1,
    },
    headbar: {
        backgroundColor: theme.palette.primary.light,
    },
    menuButton: {
        marginLeft: -18,
        marginRight: 10,
    },
});


class HeadBar extends React.Component {

    render() {
        const { classes } = this.props;

        return (
            <div className={ classes.root `PositionFixed` }>
                <AppBar className={ classes.headbar } position="static">
                    <Toolbar variant="dense">
                        <IconButton className={ classes.menuButton }>
                            <MenuIcon/>
                        </IconButton>
                        <Typography className={ classes.headbar } variant="h6">
                            ASR (Assessment Assistance)
                        </Typography>
                    </Toolbar>
                </AppBar>
            </div>
        )
    }
}

HeadBar.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default withRoot(withStyles(styles)(HeadBar));
